===Noun===
[[Image:Niigata NCM Peasant Rice Farmers House.jpg|thumb|right|350 px|The '''house''' of a Japanese rice farmer.]]
{{en-noun|pl='''[[houses]]''' or (dialectal) '''[[housen]]'''}}

# {{senseid|en|abode}} A structure serving as an [[abode]] of human beings.
#: ''This is my '''house''' and my family's ancestral home.''
# The mode of living as if in a house.
#: ''They set up '''house''' in a posh apartment.''
# The usual place to find an object or an animal.
#: ''The photo was put in its little '''house'''.''
# A structure to protect or store something or someone.
#: ''The former carriage ''house'' had been made over into a guest '''house'''.''
# A protective structure on the deck of a ship.
#: ''A pilot took charge of the wheel '''house''' until the ship was moored.''
# {{senseid|en|the theatre itself}} A [[theatre]] building, or the audience for a live theatrical or similar performance.
#: ''After her swan-song, there wasn't a dry eye in the '''house'''.''
#: ''Is there a doctor in the '''house'''?''
# {{politics}} A deliberative assembly forming a component of a legislature, or, more rarely, the room or building in which such an assembly normally meets.
# {{senseid|en|establishment}}An [[establishment]], whether actual, as a pub, or virtual, as a website. Particularly restaurant, casino, or financial or trading company.
#: ''a bottle of '''house''' wine''
#: ''You do not need to pay â€“ your meal is on the '''house.'''''
#: ''the '''house''' edge on roulette is quite low''
#: ''the '''house''' of Morgan''
# {{business}} A company or organisation.
#: ''A small publishing '''house''' would have a contract with an independent fulfillment '''house'''.''
# A dynasty, a familial descendance, for example, a royal House.
#: ''The current Queen is from the '''House''' of Windsor.''
# {{astrology}} One of the twelve divisions of an astrological chart.
# A [[grouping]] of [[schoolchildren]] for the purposes of competition in sports and other activities.
#: ''I was a member of Spenser '''house''' when I was at school.''
# {{senseid|en|genre of music}}[[house music|House music]].
# {{curling}} The four [[concentric]] circles where points are scored on the [[ice]]
# An early or alternative name for the game [[bingo]].
# {{British}} A complete set of numbers in [[bingo]].
# {{uncountable|US}} An aggregate of characteristics of a house.
#* {{quote-news|title=Goin' South Affordable is trendy in these suburbs|work=Chicago Tribune|date=Feb 24|year=1990|passage=In comparison with the western suburbs, we felt we could get a lot more '''house''' for the money.}}
#* {{quote-news|title=DOWNSIZERS LIVE IT UP - BABY BOOMERS WANT SMALLER HOMES WITH LOTS OF...|work=Pittsburgh Post-Gazette|date=Jan 16|year=2005|passage=There's just a huge number of people who are close to retirement and feel they have too much '''house''' on too much property.}}
#* {{quote-news|title=When Will the Slump End?|work=Newsweek|date=Nov 6|year=2007|passage=Those homeowners who bought too much '''house''', or borrowed against inflated values are now going to be liable for their own poor decisions}}
# {{rft-sense|proper noun?|lang=en}} {{uncountable}} A [[child]]ren's [[game]] in which the players [[pretend]] to be members of a [[household]].
#: ''As the babysitter, Emma always acted as the mother whenever the kids demanded to play '''house'''.''

